import React, { Component } from 'react';
import Movie from './Movie';

export default class Movies extends Component {
  state = {
    movies: [
      { name: 'John Wick Parabellum', genre: 'Action', year: 2019 },
      { name: 'Jaws', genre: 'Action', year: 1974 },
      { name: 'Rob Roy', genre: 'Drama', year: 1996 },
      { name: 'Jurassic Park', genre: 'Action', year: 1993 },
      { name: 'Succession', genre: 'Drama', year: 2020 },
    ]
  }

  render() {

    const renderedMovies = this.state.movies.map((movie, index) => {
      return (
        <Movie name={movie.name} />
      )
    })

    return (
      <div className="movies">
        {renderedMovies}
      </div>
    );
  }
}
